import React, {Component} from 'react'

class Faecher extends Component {
  constructor(props) {
    super(props);

    this.state = {
      faecher: [],
    }
  }

  render() {
    return (
      <p>Faecher wird gerendert</p>
    )
  }
}

export default Faecher;
